const intialState = {
  products: []
};

const productReducer = (state = intialState, {type,payload}) => {
  switch (type) {
    case "SET_PRODUCTS": {

      console.log("SET_PRODUCTS reducer==== ", state);
      return {...state,products:payload};
    }
    default:
      return state;
  }
};

export default productReducer;
